import { React } from "react";
import { Link, Outlet, Route, Routes } from "react-router-dom";

import Navbar from "./components/Navbar.js";
import HomeFeature from "./components/HomeFeature.js";
import PortfolioPage from "./components/pages/PortfolioPage.js";
import AboutPage from "./components/pages/AboutPage.js";
import Wordplay from "./components/projects/Wordplay.js";

export default function App() {
  // const location = useLocation();

  // useEffect(() => {
  //   require('preline/preline');
  // }, []);

  // useEffect(() => {
  //   // @ts-ignore
  //   HSStaticMethods.autoInit();
  // }, [location.pathname]);

  return (
    <div>
      {/* <NavResponse />
      <br /><br /><br /><br />
      <div className="border border-black"></div> */}
      <Navbar />
      {/* <div className="border border-black"></div> */}
      {/*  */}

      <Routes>
        <Route index element={<HomeFeature />} />
        <Route path="/about" element={<AboutPage />} />

        <Route path="/portfolio" element={<PortfolioPage />}>
          <Route path="wordplay" element={<Wordplay />} />
        </Route>

        <Route path="*" element={<PageNotFound />} />
      </Routes>
      <Outlet />
    </div>
  );
}

function PageNotFound(props) {
  return (
    <main className="grid min-h-full place-items-center bg-white px-6 py-24 sm:py-32 lg:px-8">
      <div className="text-center">
        {/* #AE7E6F eee4e1 */}
        <p className="text-base font-semibold text-[#BD9589]">404</p>
        <h1 className="mt-4 text-3xl font-bold tracking-tight text-gray-900 sm:text-5xl">Page not found</h1>
        <p className="mt-6 text-base leading-7 text-gray-600">Sorry, this page doesn't exist.</p>

        <div className="mt-10 flex items-center justify-center gap-x-6">
          <Link to="/" className="rounded-md bg-[#eee4e1] px-3.5 py-2.5 text-sm font-semibold text-black shadow-sm hover:outline hover:outline-2 hover:outline-[#eee4e1] hover:bg-white transition duration-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600">
            Go back home
          </Link>
        </div>
      </div>
    </main>
  );
}
